import React from 'react';
import { Link } from 'react-router-dom'; // Adjust if you are using a different routing method
import { FaRobot } from 'react-icons/fa'; // Using FontAwesome for the chatbot icon
import './Navbar.css'; // Make sure to include any necessary styles

function Navbar({ onChatbotClick }) {
  return (
    <nav className="navbar">
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/about">About</Link></li>
        <li><Link to="/services">Services</Link></li>
        <li>
          <button className="chatbot-btn" onClick={onChatbotClick}>
            <FaRobot /> Chatbot
          </button>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
